  false,\n\t\"url\": null,\n\t\"notes\": \"The CalFish Abundance Database contains
  a comprehensive collection of anadromous fisheries abundance information. Beginning
  in 1998, the Pacific States Marine Fisheries Commission, the California Department
  of Fish and Game, and the National Marine Fisheries Service, began a cooperative
  project aimed at collecting, archiving, and entering into standardized electronic
  formats, the wealth of information generated by fisheries resource management agencies
  and tribes throughout California. Extensive data are currently available for chinook,
  coho, and steelhead. Major data categories include adult abundance population estimates,
  actual fish and/or carcass counts, counts of fish collected at dams, weirs, or traps,
  and redd counts. Harvest data has been compiled for many streams, and hatchery return
  data has been compiled for the states mitigation facilities. A draft format has
  been developed for juvenile abundance and awaits final approval. This CalFish Abundance
  Database shapefile was generated from fully routed 1:100,000 hydrography. In a few
  cases streams had to be added to the hydrography dataset in order to provide a means
  to create shapefiles to represent abundance data associated with them. Streams added
  were digitized at no more than 1:24,000 scale based on stream line images portrayed
  in 1:24,000 Digital Raster Graphics (DRG). These features generally represent abundance
  counts resulting from stream surveys. The linear features in this layer typically
  represent the location for which abundance data records apply. This would be the
  reach or length of stream surveyed, or the stream sections for which a given population
  estimate applies. In some cases the actual stream section surveyed was not specified
  and linear features represent the entire stream. In many cases there are multiple
  datasets associated with the same length of stream, and so, linear features overlap.
  Please view the associated datasets for detail regarding specific features. In\",\n\t\"license_title\":
